import { Box } from "@mui/system";
import { Toolbar } from "@mui/material";
import axios from 'axios';
import * as React from 'react';
import { HostsData } from "./HostsInfo";
import { ControlledAccordions } from "./HostsInfo";
import { HealthStatus } from "./HostsInfo";
import { Typography } from "@material-ui/core";

const dummy:HostsData={
  "_id": "62cd1ed6abcbc185f5607e75",
    "name": "Christie",
    "description": "et ipsum nisi id deserunt sunt culpa consequat",
    "OS": "Vortexaco",
    "Running_services": 2,
    "Running_instances": 7,
    "health_status": Heat,
    "services": [
      {
        "Name": "Potter",
        "Instances": 3
      },
      {
        "Name": "Clare",
        "Instances": 3
      },
      {
        "Name": "Willa",
        "Instances": 3
      }
    ],
    "labels": [
      "host-1",
      "main-host"
    ],
    "number of cores": 4,
    "processor_type": "Intel Core",
    "memory": "15.4 GiB",
    "total_storage": "512 GiB",
    "storage_mounts": [
      {
        "Mount_point": "abc",
        "Storage": "23"
      }
    ]
}


export const HostsInfoLanding =()=>{

  const [data,setData]=React.useState<HostsData>(dummy);

  const getProductData = async () => {
      try {
        const data = await axios.get<HostsData>(
            'https://my-json-server.typicode.com/sakthi-vunet/dummyhostsinfo/list'
        );

        setData(data.data);
      } catch (e) {
        console.log(e);
      }
    };
  React.useEffect(() => {
      getProductData();

  }, []);

  return (
    <Box
      component="main"
      sx={{ flexGrow: 1, p: 3, marginLeft: {  sm: `200px`, md: `200px`}}}>
      <Toolbar />
      <Typography>
        Hosts {'>>'} Hosts1
      </Typography>
      <span style={{marginLeft:'.5rem'}}/>

    <ControlledAccordions data={data} />

</Box>

  );
};
